// IDs, see IAM Identifiers (http://docs.aws.amazon.com/IAM/latest/UserGuide/Using_Identifiers.html)
// in the Using IAM guide.

UserDetail.Documentation:
// Contains information about an IAM user, including all the user's policies
// and all the IAM groups the user is in.
// 
// This data type is used as a response element in the GetAccountAuthorizationDetails
// action.

Path.Documentation:
// The path to the user. For more information about paths, see IAM Identifiers
// (http://docs.aws.amazon.com/IAM/latest/UserGuide/Using_Identifiers.html)
// in the Using IAM guide.

UserId.Documentation:
// The stable and unique string identifying the user. For more information about
// IDs, see IAM Identifiers (http://docs.aws.amazon.com/IAM/latest/UserGuide/Using_Identifiers.html)
// in the Using IAM guide.

UserListType.Documentation:
// Contains a list of users.
// 
// This data type is used as a response element in the GetGroup and ListUsers
// actions.

Base32StringSeed.Documentation:
// The Base32 seed defined as specified in RFC3548 (http://www.ietf.org/rfc/rfc3548.txt).
// The Base32StringSeed is Base64-encoded.
//
// Base32StringSeed is automatically base64 encoded/decoded by the SDK.

QRCodePNG.Documentation:
// A QR code PNG image that encodes otpauth://totp/$virtualMFADeviceName@$AccountName?secret=$Base32String
// where $virtualMFADeviceName is one of the create call arguments, AccountName
// is the user name if set (otherwise, the account ID otherwise), and Base32String
// is the seed in Base32 format. The Base32String value is Base64-encoded.
//
// QRCodePNG is automatically base64 encoded/decoded by the SDK.

arnType.Documentation:
// The Amazon Resource Name (ARN). ARNs are unique identifiers for AWS resources.
// 
// For more information about ARNs, go to Amazon Resource Names (ARNs) and
// AWS Service Namespaces (http://docs.aws.amazon.com/general/latest/gr/aws-arns-and-namespaces.html)
// in the AWS General Reference.

thumbprintType.Documentation:
// Contains a thumbprint for an identity provider's server certificate.
// 
// The identity provider's server certificate thumbprint is the hex-encoded
// SHA-1 hash value of the self-signed X.509 certificate used by the domain
// where the OpenID Connect provider makes its keys available. It is always
// a 40-character string.

Operation.Documentation:
